हम सिर्फ आपको ही हर शाम हर पल चाहते रहेंगे, 
आप मिलो या ना मिलो हमें , हम किसी और को चाहने की वजाय;
आपकी यादों के साथ ही मरना पसंद करेंगे 🥰

